import logo from './logo.svg';
import './App.css';

// a function returning a title paragraph component
function Title(title) {
  return <p>Hellow paragraph in react {title}</p>;
}

function App() {
  const title = 'bla bla';
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit this {title} <code>src/App.js</code> and save to reload.
        </p>
        <Title title={title} />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
